import React, { Component } from 'react';
import { connect } from 'react-redux';
import {
  Button,
  Col,
  Form,
  Input,
  InputGroup,
  InputGroupAddon,
  InputGroupText,
  Row,
  Table
} from 'reactstrap';
import axios from 'axios';

class Event extends Component {
  constructor(props){
    super(props)
  }

  render(){
    return(
      <Table striped>
      <thead>
        <tr>
          <th>#</th>
          <th>Company Name</th>
          <th>Vendor Name</th>
          <th>Proposed Date</th>
          <th>status</th>
          <th>Date Created</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <th scope="row">1</th>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
      </tbody>
    </Table>
    )
  }
}

export default Event
